import AboutUsPage from "../page/AboutUsPage";
import BlogPage from "../page/BlogPage";
import ContactUsPage from "../page/ContactUsPage";
import HomePage from "../page/HomePage";
import OurservicePage from "../page/OurservicePage";

export const routes =[
    {
        path : "/",
        page :HomePage
    },
    {
        path : "/aboutus",
        page :AboutUsPage
    },
    {
        path : "/contact",
        page :ContactUsPage
    },
    {
        path : "/ourservice",
        page :BlogPage
    },
    {
        path : "/blog",
        page :OurservicePage
    },
    {
        path : "/ourservice",
        page :OurservicePage
    },
    {
        path : "/ourservice",
        page :OurservicePage
    },
]
